 // Awareness Counter
let count = 0;
document.getElementById("awareness-btn").addEventListener("click", function() {
    count++;
    document.getElementById("count").innerText = count;
});

// Image Slideshow of Indian Cow Breeds
const breeds = [
     { name: "Sahiwal", img: " data:image/jpeg;base64," },
    { name: "Red Sindhi", img: " data:image/jpeg;base64," },
    { name: "Tharparkar", img: " data:image/jpeg;base64," },
    { name: "Kankrej", img: " https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRihydDJH5q862pb6GAFg4knG1YXvcoTZeD2g&s" },
    { name: "Gir", img: " data:image/jpeg;base64," }

];

let currentIndex = 0;
document.getElementById("next").addEventListener("click", function() {
    currentIndex = (currentIndex + 1) % breeds.length;
    updateSlideshow();
});

document.getElementById("prev").addEventListener("click", function() {
    currentIndex = (currentIndex - 1 + breeds.length) % breeds.length;
    updateSlideshow();
});

function updateSlideshow() {
    document.getElementById("breed-image").src = breeds[currentIndex].img;
    document.getElementById("breed-name").innerText = breeds[currentIndex].name;
}
